import React from "react";
import styled from "styled-components";
import cover from "../../Assets/selfparking.jpg";

const HeadMain = () => {
    return (
        <HeadContainer>
            <ImageContainer>
                <StyledImg src={cover} alt="Imagem de capa" />
            </ImageContainer>
            <Content>
                <h1>Olá Terráqueos</h1>
                <p>Explore e compartilhe ideias incríveis!</p>
            </Content>
        </HeadContainer>
    );
};

const HeadContainer = styled.section`
    display: flex;
    width: 100vw;
    height: 100vh;
    overflow: hidden;
`;

const ImageContainer = styled.div`
    flex: 1;
    display: flex;
    align-items: center;
    justify-content: center;
    
`;

const StyledImg = styled.img`
    max-width: 100%;
    max-height: 100%;
    object-fit: contain;
`;

const Content = styled.div`
    flex: 1; 
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: flex-start;
    padding: 40px;
    background: #000; 
    color: white;

    h1 {
        font-size: 55px;
        margin-bottom: 10px;
    }

    p {
        font-size: 24px;
    }
`;

export default HeadMain;
